sys_variable_value.value:
(function execute(inputs, outputs) {
// ... code ...
var res=(inputs.res);
gs.info(JSON.stringify(res.head.stausCode_))
if(res.head.stausCode_==200 || res.body.capdocid){
    outputs.res=({  "clientid":inputs.clientid,
                    "reqcd":inputs.reqcd,
                    "capdocid":res.body.capdocid,
                    "reqtxnkey":inputs.reqkey});
}
else{
    outputs.res=(res.head.statusMsg);
}


 

 
//gs.info(JSON.stringify(clientID));
})(inputs, outputs);

